import React from 'react';
import { List, Header, Button } from "semantic-ui-react"


export const Garments = ({ garments }) => {
	return (
		<List>
			{garments.map(garment => {
				return(
					<List.Item key={garment.gtin} key={garment.colorName} key={garment.piecePrice}> 
						<div class = "ui card">


							Gtin: {garment.gtin}<br/>
							Color: {garment.colorName}<br/>
							Price: {Math.round((garment.piecePrice *2))}

						</div>

					</List.Item>
					)
			})}

		</List>

	)
}
